import React from 'react';

//Profile
import Profile_image from '../../images/hiren_karangiya_profile.jpg';
import Profile from './Profile';

//About
import About from './About';


class Header extends React.Component {

    render(){
        return(

            <header className="header">
                <div className="container">
                    <div className="row">

                        <Profile url={Profile_image} />

                        <About 
                            name="Hiren H. Karangiya" 
                            designation="Frontend Developer" 
                            info="Credibly embrace visionary internal or 'organic' sources and business benefits. Collaboratively integrate efficient portals rather than customized customer service. Assertively deliver frictionless services via leveraged interfaces. Conveniently evisculate accurate sources and process-centric expertise.Energistically fabricate customized imperatives through cooperative catalysts for change."
                        />
                        
                    </div>
                </div>
            </header>

        );
    }

}

export default Header;
